                </span>
                <span style={{"padding-left": "10px", "padding-right": "60px"}}>
                    <text>Likes</text>
                </span>
                <span style={{"padding-left": "10px", "padding-right": "60px"}}>
                    <text>Network</text>
                </span>
            </div>


        </div>


    );
}

export default ProfListItem;
